eightOut))","params":{"amountIn":"source reserve amount","reserveIn":"source reserve balance","reserveOut":"target reserve balance","swapFee":"swap fee of the conversion","tokenWeightIn":"source reserve weight, represented in ppm (2-98)","tokenWeightOut":"target reserve weight, represented in ppm (2-98)"},"returns":{"amountOut":"amountOut"}},"optimalExp(uint256)":{"details":"computes e ^ (x / FIXED_1) * FIXED_1 input range: 0 <= x <= OPT_EXP_MAX_VAL - 1 auto-generated via "PrintFunctionOptimalExp.py" Detailed description: - Rewrite the input as a sum of binary exponents and a single residual r, as small as possible - The exponentiation of each binary exponent is given (pre-calculated) - The exponentiation of r is calculated via Taylor series for e^x, where x = r - The exponentiation of the input is calculated by multiplying the intermediate results above - For example: e^5.521692859 = e^(4 + 1 + 0.5 + 0.021692859) = e^4 * e^1 * e^0.5 * e^0.021692859"},"optimalLog(uint256)":{"details":"computes log(x / FIXED_1) * FIXED_1 Input range: FIXED_1 <= x <= OPT_LOG_MAX_VAL - 1 Auto-generated via "PrintFunctionOptimalLog.py" Detailed description: - Rewrite the input as a product of natural exponents and a single residual r, such that 1 < r < 2 - The natural logarithm of each (pre-calculated) exponent is the degree of the exponent - The natural logarithm of r is calculated via Taylor series for log(1 + x), where x = r - 1 - The natural logarithm of the input is calculated by summing up the intermediate results above - For example: log(250) = log(e^4 * e^1 * e^0.5 * 1.021692859) = 4 + 1 + 0.5 + log(1 + 0.021692859)"},"power(uint256,uint256,uint32,uint32)":{"details":"General Description:     Determine a value of precision.     Calculate an integer approximation of (_baseN / _baseD) ^ (_expN / _expD) * 2 ^ precision.     Return the result along with the precision used. Detailed Description:     Instead of calculating "base ^ exp", we calculate "e ^ (log(base) * exp)".     The value of "log(base)" is represented with an integer slightly smaller than "log(base) * 2 ^ precision".     The larger "precision" is, the more accurately this value represents the real value.     However, the larger "precision" is, the more bits are required in order to store this value.     And the exponentiation function, which takes "x" and calculates "e ^ x", is limited to a maximum exponent (maximum value of "x").     This maximum exponent depends on the "precision" used, and it is given by "maxExpArray[precision] >> (MAX_PRECISION - precision)".     Hence we need to determine the highest precision which can be used for the given input, before calling the exponentiation function.     This allows us to compute "base ^ exp" with maximum accuracy and without exceeding 256 bits in any of the intermediate computations.     This functions assumes that "_expN < 2 ^ 256 / log(MAX_NUM - 1)", otherwise the multiplication should be replaced with a "safeMul".     Since we rely on unsigned-integer arithmetic and "base < 1" ==> "log(base) < 0", this function does not support "_baseN < _baseD"."}},"version":1},"userdoc":{"kind":"user","methods":{},"version":1}},"settings":{"compilationTarget":{"contracts/RequiemFormulaTest.sol":"RequiemFormulaTest"},"evmVersion":"london","libraries":{},"metadata":{"bytecodeHash":"ipfs","useLiteralContent":true},"optimizer":{"enabled":true,"runs":200},"remappings":[]},"sources":{"contracts/RequiemFormulaTest.sol":{"content":"// SPDX-License-Identifier: MIT

